import 'bootstrap/dist/css/bootstrap.min.css';

import React from 'react';
import {Navbar, Nav} from 'react-bootstrap';
import './index.css'; 

const Nav_bar = () => {
    return(
        <Navbar expand='lg'>
            <Navbar.Brand>Ezeiyoke Cosmas</Navbar.Brand>
            <Navbar.Toggle/>
            <Navbar.Collapse>

                <Nav className='me-auto'>
                    <Nav.Link href='#'>Home</Nav.Link>
                    <Nav.Link href='#'>Instuctions</Nav.Link>

                </Nav>
            </Navbar.Collapse>
            </Navbar>
        
    );
}


const Bodycontent = () => {
    return(
        <div className='container question-cont'>
            <div className='row mb-4 question-row'>
                <div className='col-lg-6'>
                    <div className='total-time'><h6>Total Time</h6></div>
                    <div className='progress progress-rule' role='progressbar'></div>
                </div>
            
               
            <div className='row mb-2'>
              <div className='col-lg-6 question'>
              <h5 className='score'>0/65</h5>
                <h6>The best database storage</h6>
                <div className='option'>
                <ul className='option-list'>
                    <li className='options1'>A. rds</li>
                   <li className='options1'>B. dyamno</li>
                   <li className='options1'>C. auro</li>
                    <li className='options1'>D. athen</li>
                </ul>
                </div>
               
            </div>
            </div>
                
            </div>

        </div>
    );
}


function App() {
    return(

        <div className='app'>

            <Nav_bar />
            <Bodycontent/>

        </div>

    )


}

export default App
